import React, { useState, useEffect } from "react";
import { Route, Redirect, Switch } from "react-router-dom";
// import Homepage from "../homepage/Homepage";
import Dashboard from "../homepage/Dashboard";
import LoginForm from "../auth/LoginForm";
import SignupForm from "../auth/SignupForm";
import FoodList from "../food/FoodList";
import NewFoodForm from "../food/NewFoodForm";
import ClientList from "../clients/ClientList";
import NewClientForm from "../clients/NewClientForm";
import EditClientForm from "../clients/EditClientForm";
import ClientDetails from "../clients/ClientDetails";
import NewOrderForm from "../orders/NewOrderForm";
import OrderList from "../orders/OrderList";
import OrderDetails from "../orders/OrderDetails";
import PurchaseList from "../purchases/PurchaseList";
import NewPurchaseForm from "../purchases/NewPurchaseForm";
import PurchaseDetails from "../purchases/PurchaseDetails";
import ProtectedRoute from "./ProtectedRoutes";
import PantryApi from "../pantryApi";

function Routes({ login, signup, food }) {
  return (
    <div>
      <Switch>
        <Route exact path="/">
          <LoginForm login={login} />
        </Route>

        <Route exact path="/home">
          <Dashboard food={food} />
        </Route>

        <ProtectedRoute
          exact
          path="/signup"
          signup={signup}
          component={SignupForm}
        />

        <Route exact path="/food">
          <FoodList food={food} />
        </Route>

        <Route exact path="/food/new">
          <NewFoodForm />
        </Route>

        <Route exact path="/clients" component={ClientList} />

        <Route exact path="/clients/new">
          <NewClientForm clients={clients} />
        </Route>

        <Route exact path="/clients/:clientId" component={ClientDetails} />
        <Route
          exact
          path="/clients/:clientId/edit"
          component={EditClientForm}
        />

        <Route exact path="/clients/:clientId/orders/new">
          <NewOrderForm food={food} />
        </Route>

        <Route exact path="/orders" component={OrderList} />
        <Route exact path="/orders/new">
          <OrderList food={food} />
        </Route>

        <Route exact path="/orders/:orderId">
          <OrderDetails />
        </Route>

        <Route exact path="/purchases" component={PurchaseList} />

        <Route exact path="/purchases/new">
          <NewPurchaseForm food={food} />
        </Route>

        <Route
          exact
          path="/purchases/:purchaseId"
          component={PurchaseDetails}
        />

        <Redirect to="/" />
      </Switch>
    </div>
  );
}
export default Routes;
